import React from 'react';
import { View,Text,Button,StyleShee } from 'react-native';
import MyButton from '../components/MyButton';

export default function(props){
    console.log(props);

    return(
        <View>
            <Text> Нүүр хуудас</Text>

        <View>
            <MyButton title='Нэвтрэх'onPress={()=>props.navigation.navigate("Login")}/>
            <MyButton title='FlatList' onPress={()=>props.navigation.navigate("FlatList")}/>
            <MyButton title='Flexbox' onPress={()=>props.navigation.navigate("Flexbox")}/>
        </View>
        </View>
    );
}
